Court finds State has complied with victim notification.  Sentencing hearing proceeded.  Statements made as to sentencing.

AS TO COUNT 3:
The court sentenced the defendant to 3 MONTHS in the House of Correction (CONSECUTIVE).  

AS TO COUNT 4:
The court sentenced the defendant to 9 MONTHS in the House of Correction (CONSECUTIVE), with credit for 149 DAYS time served.  

AS TO COUNT 5:
The court sentenced the defendant to 3 MONTHS in the House of Correction (CONCURRENT to COUNT 4).  

AS TO ALL COUNTS:
Court STAYED sentences and placed defendant on PROBATION for 24 MONTHS.
CONDITIONS OF PROBATION:
-Serve 30 DAYS in the House of Correction as Condition Time (as to COUNT 3), STAYED pending review;
-Batterers Intervention program;
-Mental health evaluation, comply with recommended treatment;
-AODA assessment, comply with recommended treatment;
-Treatment and/or counseling as determined by agent;
-Absolute sobriety;
-No contact with victim S.L. unless approved by the Court and completion of BIP classes;
-Third party contact for the purpose of child visitation, third party to be approved by the victim and Family Court;
-Obtain/maintain employment;
-No contact with firearms;
-Provide DNA sample;
-Court WAIVES all non-mandatory court costs and fees;
-Pay all mandatory supervision fees, court costs, fees, and surcharges including: DNA & DV surcharges during period of probation.  Unpaid amount to convert to a civil judgment;  
-Court orders restitution set at $1,136.56 payable to S.L.

Defendant to report to probation intake and provide DNA sample by 8/3/2022.

*Court advised defendant of right to seek post conviction relief.
*Court advised that under 18 USC Section 922(g)(9) the defendant is prohibited from possession of a firearm and/or ammunition after conviction of a crime of domestic violence.

Filed: 
Memorandum of Conditions of Probation.

Probation Review Hearing in Branch 35. Parties are advised that effective August 1, 2022 this case will be assigned to Judge Audrey Skwierawski, Branch 41 in Room 501 of the Courthouse. Probation Review Hearing scheduled for November 18, 2022 at 01:30 pm.
